            >
              contact
            </Link>
          </li>
          <li>
            <Link
              to="/news"
              className="header__nav--link"
              style={{
                textDecoration: props.accueil,
                borderBottom: props.border,
              }}
            >
              News
            </Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}
